import React, { useState } from 'react';
import axios from 'axios'; // API 

const StocksProvider = {
    GetGME: async function() {
        await axios.get('https://api.npms.io/v2/search?q=axios')
        .then((response) => {
            console.log(response.status, response, response.data);
        });
    },
}

export default StocksProvider
